//Don't leave this blank or use your actual Steam account name.
// Set the steam account, blank means anonymous (see Steam https://steamcommunity.com/dev/managegameservers)
//
serverSteamAccount 
//
//	
//Time between server auto saves in minutes
serverAutoSaveInterval ![serverAutoSaveInterval]
//	
//Game difficulty mode.Must be set to Peaceful / Normal / Hard / HardSurvival
difficulty ![difficulty]
//
//Must be set to New or Continue. 	 
initType ![initType]
//	
//Slot to save the game. Must be set to either slot 1 / slot 2 / slot 3 / slot 4 / slot 5.
//slot 1
//
//Show event log.	
showLogs on
//	 
//Contact email
serverContact
//	
//No enemies
veganMode ![veganMode]	
